import { BrowserRouter as Router, Switch, Route, Link, Routes} from "react-router-dom";
import Header from "./components/Header/Header";
import Home from "./components/Home/Home";

function App() {
  return (
    <Router> 
    <div className="App">
          {Header}
          <Switch>
            <Route path='/'><Home/></Route>
          </Switch>
    </div>
    </Router>
  );
}

export default App;
